It's useful for reuse to provide default behaviors for some methods of a trait instead of forcing types to reimplement them. We can always keep or override each method's default behavior. Let's give the summarize method a default implementation: pub trait Summary { fn summarize(&self) -> String { String::from("(Read more...)") }
} pub struct NewsArticle { pub headline: String, pub location: String, pub author: String, pub content: String,
} impl Summary for NewsArticle {}; let article = NewsArticle { headline: String::from("Penguins win the Stanley Cup Championship!"), location: String::from("Pittsburgh, PA, USA"), author: String::from("Iceburgh"), content: String::from("The Pittsburgh Penguins once again are the best hockey team in the NHL."),
}; println!("New article available! {}", article.summarize()) We can omit an implementation for summary in impl Summary for NewsArticle {}; and are still able to call the default summary function.

